import React from 'react';
import _ from 'lodash';

export default () => {
  const childTableColDef = [
    {
      Header: 'Date Range',
      accessor: (d) => `${d.start_date} - ${d.end_date}`,
      // accessor: `${start_date} - ${end_date}`,
    },
    {
      Header: 'Margin',
      accessor: 'overall_margin$',
    },
    {
      Header: 'Revenue',
      accessor: 'overall_revenue$',
    },
    {
      Header: 'Margin %',
      accessor: 'overall_margin_perc',
    },
    {
      Header: 'Units',
      accessor: 'overall_units',
    },
    {
      Header: 'AUR',
      accessor: 'overall_aur',
    },
    {
      Header: 'AUM',
      accessor: 'overall_aum',
    },
  ];
  return childTableColDef;
};
